// src/pages/RegisterSelection.js
import React from 'react';
import { Link } from 'react-router-dom';

const RegisterSelection = () => {
  return (
    <div className="register-selection-container">
      <h1>Register</h1>
      <div className="button-container">
        <Link to="/register-regular">
          <button className="register-button">Register as Regular User</button>
        </Link>
        <Link to="/register-business">
          <button className="register-button">Register as Business User</button>
        </Link>
      </div>
    </div>
  );
};

export default RegisterSelection;
